import React from "react";
import { ReactDOM } from "react";
import './style.css';
import App from "./App";
import '../public/index.html';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render (
    <React.StrictMode>
        <App />
    </React.StrictMode>
);
